INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 2834, 20063115, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 0, "青空の下で謁見", 5118061, 10118, 1, 40, 8, "ペコリーヌとの出会い", 7, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 2835, 20063115, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 0, "未来の騎空団\nマスコット？", 5118062, 10118, 1, 40, 8, "マホとの出会い", 7, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 2837, 20063115, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 0, "お嬢さまからの\n緊急依頼", 5118063, 10118, 1, 40, 8, "アキノとの出会い", 7, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 4108402, 20063115, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 0, "黄金色の悩みごと", 5118064, 10118, 1, 40, 8, "ジュンとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 4107402, 20063115, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 0, "白熱！　格闘大会！", 5118065, 10118, 1, 40, 8, "カオリとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (2, 9000227, 20063115, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 1, "祭り太鼓はオーエドの華", 5118066, 10118, 1, 40, 8, "ニノンとの出会い", 16, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 2101181, 20063115, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 0, "人気者は遅れて\nやってくる", 5118067, 10118, 1, 40, 8, "スズナとの出会い", 19, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 4109402, 20063115, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 0, "巫女・ミーツ・魔法少女", 5118068, 10118, 1, 40, 8, "ナナカとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 4305402, 20063115, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 0, "ネズ耳は二度なくなる", 5118069, 10118, 1, 40, 8, "キャル＆コッコロとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 4101402, 20063115, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 0, "この出会いにカンパイ！", 5118070, 10118, 1, 40, 8, "ユカリとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 4106402, 20063115, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 0, "陰陽アンサンブル", 5118071, 10118, 1, 40, 8, "アオイとの出会い", 18, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (3, 2836, 20063115, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 1, "運試し十番勝負！", 5118072, 10118, 1, 40, 8, "シノブとの出会い", 7, 91002);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 0, 20063115, 0, 0, 0, "彼女たちの新たな日常", 5118600, 10118, 0, 0, 0, "オープニング", 0, 0);
